import PropTypes from 'prop-types';
import Button from '../../../../shared/Button/Button';

const StartBot = props => {
    return (
        <div>
            <h2 className='mb-7 text-2xl font-medium text-gray-800'>Start Bot</h2>
            <p className='text-gray-700 text-xl mb-3'>Start our Telegram Bot to receive trade notifications</p>
            <div className='flex justify-center'>
                <Button type={'link'}>Open Telegram Bot</Button>
            </div>
        </div>
    );
};

StartBot.propTypes = {};

export default StartBot;
